function CalPosEntropy ()


{variable.PosOpen = 0 // counter for values above EMA
variable.PosClose = 0 // counter for values above EMA
variable.PosMin = 0 // counter for values above EMA
variable.PosMax = 0 // counter for values above EMA


	if (variable.lastMax.length < FTLen) { return 0 }
	for (var i = 0 ; i < FTLen ; i++) //loop over the arrays and increment counters each time a value is above EMA5 at the same index
	{
			if (variable.lastMax[i] > variable.lastEMA5s[i])
			{
				variable.PosMax = variable.PosMax + 1
			}
			if (variable.lastMin[i] > variable.lastEMA5s[i])
			{
				variable.PosMin = variable.PosMin + 1
			}
			if (variable.lastOpens[i] > variable.lastEMA5s[i])
			{
				variable.PosOpen = variable.PosOpen + 1
			}
			if (variable.lastCloses[i] > variable.lastEMA5s[i])
			{
				variable.PosClose = variable.PosClose + 1
			}

	}
	if (variable.PosMax > 0) // calculate entropy for Max candles above EMA5 ; return Bias value if count is 0 because of LOG function
	{
		variable.EntPosMax = (variable.PosMax / FTLen) * Math.log2(1/(variable.PosMax / FTLen))
	}
	else
	{
		variable.EntPosMax = BIAS
	}
	if (variable.PosMin > 0) // calculate entropy for Min candles above EMA5 ; return Bias value if count is 0 because of LOG function
	{
		variable.EntPosMin = (variable.PosMin / FTLen) * Math.log2(1/(variable.PosMin / FTLen))
	}
	else
	{
		variable.EntPosMin = BIAS
	}
	if (variable.PosOpen > 0) // calculate entropy for Open candles above EMA5 ; return Bias value if count is 0 because of LOG function
	{
		variable.EntPosOpen = (variable.PosOpen / FTLen) * Math.log2(1/(variable.PosOpen / FTLen))
	}
	else
	{
		variable.EntPosOpen = BIAS
	}
	if (variable.PosClose > 0) // calculate entropy for Close candles above EMA5 ; return Bias value if count is 0 because of LOG function
	{
		variable.EntPosClose = (variable.PosClose / FTLen) * Math.log2(1/(variable.PosClose / FTLen))
	}
	else
	{
		variable.EntPosClose = BIAS
	}

	variable.PosEnt = variable.EntPosClose + variable.EntPosMax + variable.EntPosMin + variable.EntPosOpen //sum on 4 entropies

	return variable.PosEnt
}

